function App() {
  return (
      <div className='back1' >
      <div className='Box'>
        <span className='Title'>Авторизация</span>
        <div className='LogBox'>
          <div className='icon'>
            <span>@</span>
          </div>
          <div className='inputBoxDecor'>
            <span>Login</span>
          <input className='Inputbox' type='text'>
          </input>
          </div>
        </div>

      </div>
      </div>
  );
}
export default App;
